{
  "title": "media mQIS XM1 BP 10 CHARGE PROFILE",
  "type": "timelion",
  "params": {
    "expression": ".es(q='\"qis.xm.1.sdock.10.battery\"', timefield='@timestamp', metric='max:media-data.metrics.chargeVoltageRequest').label('Charge Voltage Request').color('orange'),\n.es(q='\"qis.xm.1.sdock.10.battery\"', timefield='@timestamp', metric='max:media-data.metrics.chargeCurrentRequest').label('Charge Current Request').color('red'),\n.es(q='\"qis.xm.1.sdock.10.battery\"', timefield='@timestamp', metric='max:media-data.metrics.soc').label('BP SoC').color('green'),\n.es(q='\"qis.xm.1.sdock.10.battery\"', timefield='@timestamp', metric='max:media-data.metrics.battCurr').label('Charging Current').color('blue'), .es(q='\"qis.xm.1.sdock.10.battery\"', timefield='@timestamp', metric='max:media-data.metrics.packVoltage').label('Pack Voltage').color('black')",
    "interval": "auto"
  },
  "aggs": []
}

